import React from 'react';
import { Link } from 'react-router';
import './ViewDataMenu.scss';

const ViewDataMenu = () => {
  return (
    <div id="view-data-menu">
      <Link to="/">
        <button type="button" className="arrow-button upper-left">
          &larr;
        </button>
      </Link>
    </div>
  );
};

export default ViewDataMenu;
